import React, {Component} from "react";
import '../tabata.css';
import Row from "react-bootstrap/Row";
import Form from "react-bootstrap/Form";

class Exercise extends Component {
    render() {
        return(
                <div>
                        <div class="circle" id="circle">
                          <div id="inner_circle"></div>
                          <div class="timeInfo">
                            <h1 id="timeR">0:00</h1>
                            <h3>Tiempo restante</h3>
                          </div>
                        </div>

                          <div class="btns">
                            <p>Tiempo de ejercicio</p>
                            <button class="mybtn btnL" id="slM">-</button>
                            <h4 id="sessL">0:00</h4>
                            <button class="mybtn btnR" id="slP">+</button>
                          </div>
                          <div class="btns">
                            <p>Tiempo de pausa</p>
                            <button class="mybtn btnL" id="blM">-</button>
                            <h4 id="breaL">0:00</h4>
                            <button class="mybtn btnR" id="blP">+</button>
                          </div>
                          <button class="btn" id="rstbtn">Reiniciar</button>
                        </div>
        );
    }
}

export default Exercise;
